import React from "react";
import Nav from "./Nav";
import Link from "next/link";
import styled from "styled-components";

const Logo = styled.h1`
	background: red;
	a {
		color: white;
		text-decoration: none;
	}
`;

function Header() {
	return (
		<header>
			<div className="bar">
				<Logo>
					<Link href="/">Sick fits</Link>
				</Logo>
			</div>

			<div className="sub-bar">
				<p>Search</p>
			</div>
			<Nav />
		</header>
	);
}

export default Header;
